/* Trigger structure for table `articulos` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `articulos_insert_stock` */$$

/*!50003 CREATE */ /*!50017 DEFINER = 'ncsoftwa_re'@'%' */ /*!50003 TRIGGER `articulos_insert_stock` AFTER INSERT ON `articulos` FOR EACH ROW BEGIN
      DECLARE done INT DEFAULT 0;
	  DECLARE codigo_articulo VARCHAR(16);	  
	  DECLARE id_local INT(2);
	  DECLARE cur1 CURSOR FOR SELECT IdLocalLOC FROM locales 
							  WHERE IdLocalLOC<>1 AND IdLocalLOC<>2;
	  DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done = 1;
	  OPEN cur1;
	  REPEAT
		FETCH cur1 INTO id_local;
		IF NOT done THEN
		INSERT INTO stock(IdArticuloSTK, IdLocalSTK, CantidadSTK) VALUES(new.IdArticuloART, id_local, 0);
		END IF;
	  UNTIL done END REPEAT;
	  CLOSE cur1;
    END */$$


